import React, { Component } from 'react';

class Calendar extends Component {
  render() {
    return (
      <div className="calendar">
        <table>
            <tbody>
                <tr>
                    <td>1</td>
                </tr>
            </tbody>
        </table>
      </div>
    );
  }
}

export default Calendar;
